Roman and Early Christian Painting
Heron Books | 1966 | English | 216 pages | PDF | 31.6 MB

The world of the ancients encompassed both the despair of Lucretius and the joyful optimism of the apostles. It was a world of which Flaubert said, &quot;the gods no longer existed, and Christ had not yet arrived. Here, between the period of Cicero and that of Marcus Aurelius, was a unique moment in time, when man existed alone, a greatness unknown before or since...&quot;
